import React from 'react';
import logo from './logo.svg';
import './App.css';
import './project_page.css';
import ProjectImg from "./ProjectImg"
import ProjectSection from "./ProjectSection"
import NavBar from "./NavBar"

function GooglePage() {
  return (
    <div className="project-page">
      <div className="main">
        <div className="app-header">
          <p className="nav-header">Go back</p>
            <div className="project-title">
              <h1>Google Internship</h1>
            </div>
            <div className="project-description">
              <h2>Prototyped solutions for discoverability in Google Sheets with an accessibility first lens.</h2>
              <p className="header3">Role: UX Engineering Intern</p>
              <p className="header3">Team: Google Sheets</p>
            </div>
            <ProjectImg imgUrl={require("./assets/google/team.png")} height="40%" position="-10% 75%"/>
            <ProjectSection title="01 - What is UX Engineering"/>
        </div>

      </div>


      <NavBar email="cathleenjia@berkeley.edu"/>


  </div>
  );
}

export default GooglePage;
